import React from 'react';
import uuid from 'uuid';
import {Button,Card,CardHeader,CardBody,FormGroup,Form,Input,Row,Col} from "reactstrap";

const item=(props)=>{


const element= props.variables;

  return (

        <tr key={uuid()}>
          <th key={(element._id)} className="text-right">
            {(element.nombre)}
          </th>

          <th key={(element._id)} className="text-right">
            {(element.correo)}
          </th>

          <th key={(element._id)} className="text-right">
            {(element.canton)}
          </th>

          <th key={(element._id)} className="text-right">
            {(element.provincia)}
          </th>
          <th>
          <Button className=".col-" outline color="info" size="sm">Edit</Button>
          <Button className=".col-" outline color="danger" size="sm">Remove</Button>
          </th>
        </tr>


  )
};

export default item;
